social_posts.post_text:
We're Super excited to announce @eartheater and @kngwmn as part of the WavyLand 5 year anniversary Vivid event. Second release tickets are now on sale - we look forward to seeing you all there 

For the WavyLand team and for everyone that has supported us over the years, this will be a very special event.  Featuring sets from ethereal multi-instrumentalist and producer Eartheater (USA), vaporwave pioneer George Clanton (USA), NYC-based Iranian songwriter Kris Esfandiari's dark doom-rock band King Woman, techno producer Varg²™ (Sweden), London's eclectic IGLOOGHOST, Melbourne producer C.FRIM and Toronto's dark industrial star Debby Friday, we will be transforming Metro Theatre into a vibrant hub of creativity, ingenuity and fun.

OFFICIAL PROGRAM 

@eartheater (USA)
@kngwmn (USA)
@georgeclanton (USA)
@varg2tm (SWE)
@iglooghost (UK)
@c.frim (AUS)
@debbyfriday (CA)

TICKETS ON SALE NOW! via the ticket link in the bio. 
Don't miss out 

this Event is supported by Vivid Sydney and City of Sydney

Visit WavyLand.com.au for all ticket and event information.

